    protected override async Task OnInitializedAsync()
    {
        try {
        storeName = await storeDataService.getStoreName();
        valtoken = await sessionStorage.ContainKeyAsync("token");
    
        if (valtoken == false ) {
            nav.NavigateTo("/UserLogin");
        }

        } catch (Exception e) {
            if (e.Message.Length > 0){
                nav.NavigateTo("/UserLogin");
            }
        }
        

    }



